import Vue from 'vue'
import VueRouter from 'vue-router'
import MainView from "@/views/MainView"
import AboutView from "@/views/AboutView"
import LoginView from "@/views/LoginView"
import RegisterView from "@/views/RegisterView";
import ChartIndex from "@/views/chartview/ChartIndex";
import UserIndex from "@/views/userview/UserIndex";
import FileIndex from "@/views/fileview/FileIndex";
import GoodIndex from "@/views/goodview/GoodIndex";
import SettingIndex from "@/views/settingview/SettingIndex";

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: '首页',
    component: MainView,
    children: [
      {
        path: 'home',
        name: '主页',
        component: ChartIndex
      },
      {
        path: 'system',
        name: '系统',
        component: UserIndex
      },
      {
        path: 'file',
        name: '文件',
        component: FileIndex
      },
      {
        path: 'shop',
        name: '业务',
        component: GoodIndex
      },
      {
        path: 'setting',
        name: '设置',
        component: SettingIndex
      }
    ]
  },
  {
    path: '/about',
    name: '关于',
    component: AboutView
  },
  {
    path: '/login',
    name: '登录',
    component: LoginView
  },
  {
    path: '/register',
    name: '注册',
    component: RegisterView
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
